import React, { useEffect, useState } from 'react'
import Player from '../../models/Player';

const [ player, setPlayer ] = useState({});

useEffect(() => {
    let p = new Player();
    p.setNome("mFL");
    p.setCor("azul");
    setPlayer(p);
}, [] )

function Home() {
    return (<>
        <span>{player.getNome()}</span>
    </>)
}

export default Home;
